          new go.Binding("figure", "isTreeExpanded",
                         function(exp, shape) {
                           var but = shape.panel;
                           return exp ? but["_treeExpandedFigure"] : but["_treeCollapsedFigure"];
                         })
              .ofObject()),
        // assume initially not visible because there are no links coming out
