  /** @type {number} */
  this._direction = 0;
  /** @type {number} */
  this._extension = 30;
  /** @type {number} */
  this._inset = 10;
  /** @type {number} */
  this._gap = 10;
}
go.Diagram.inherit(DimensioningLink, go.Link);

