  fig2.add(new go.PathSegment(go.PathSegment.Line, .85 * w, .6 * h));
  fig2.add(new go.PathSegment(go.PathSegment.Line, .85 * w, .35 * h));
  r = .025;
  cpOffset = KAPPA * r;
